import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { supabase } from '../../supabaseClient';
import logo from '../../icons/logo.png';
import { FaMoon, FaBell, FaUserCircle } from 'react-icons/fa';

const Navbar = () => {
  const [dropdownOpen, setDropdownOpen] = useState(false);
  const navigate = useNavigate();

  const toggleDropdown = () => setDropdownOpen((prev) => !prev);

  const handleLogout = async () => {
    try {
      const { error } = await supabase.auth.signOut();
      if (error) throw error;

      // Close the dropdown
      setDropdownOpen(false);

      // Clear any local storage or session data if needed
      localStorage.removeItem('userPreferences');

      // Navigate to login page
      navigate('/login', { replace: true }); // Using replace to prevent going back
    } catch (error) {
      console.error('Logout failed:', error.message);
      alert('Logout failed. Please try again.');
    }
  };

  return (
    <nav style={styles.navbar}>
      <div style={styles.logoContainer}>
        <img src={logo} alt="Ecologicca" style={styles.logo} />
      </div>

      <div style={styles.rightSection}>
        <button style={styles.iconButton}>
          <FaMoon style={styles.icon} />
        </button>
        <button style={styles.iconButton}>
          <FaBell style={styles.icon} />
        </button>
        <div style={styles.userSection}>
          <button style={styles.userButton} onClick={toggleDropdown}>
            <FaUserCircle style={styles.userIcon} />
          </button>
          {dropdownOpen && (
            <div style={styles.dropdownContent}>
              <button style={styles.dropdownItem} onClick={handleLogout}>
                Logout
              </button>
            </div>
          )}
        </div>
      </div>
    </nav>
  );
};

const styles = {
  navbar: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '12px 24px',
    backgroundColor: '#FFFFFF',
    borderBottom: '1px solid rgba(4, 58, 36, 0.1)',
  },
  logoContainer: {
    display: 'flex',
    alignItems: 'center',
  },
  logo: {
    height: '40px',
    width: 'auto',
  },
  rightSection: {
    display: 'flex',
    alignItems: 'center',
    gap: '16px',
  },
  iconButton: {
    background: 'none',
    border: 'none',
    padding: '8px',
    cursor: 'pointer',
    borderRadius: '50%',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    color: '#043A24',
    transition: 'all 0.3s ease',
    '&:hover': {
      backgroundColor: 'rgba(4, 58, 36, 0.1)',
    },
  },
  icon: {
    fontSize: '20px',
  },
  userSection: {
    position: 'relative',
  },
  userButton: {
    background: 'none',
    border: 'none',
    padding: '8px',
    cursor: 'pointer',
    display: 'flex',
    alignItems: 'center',
    color: '#043A24',
  },
  userIcon: {
    fontSize: '24px',
  },
  dropdownContent: {
    position: 'absolute',
    top: '100%',
    right: 0,
    backgroundColor: '#FFFFFF',
    boxShadow: '0 4px 8px rgba(4, 58, 36, 0.1)',
    borderRadius: '8px',
    overflow: 'hidden',
    marginTop: '8px',
    minWidth: '150px',
    zIndex: 1000,
  },
  dropdownItem: {
    width: '100%',
    padding: '12px 16px',
    border: 'none',
    background: 'none',
    textAlign: 'left',
    cursor: 'pointer',
    color: '#043A24',
    transition: 'all 0.3s ease',
    '&:hover': {
      backgroundColor: 'rgba(4, 58, 36, 0.1)',
    },
  },
};

export default Navbar;
